#import "RNSVGPathShadowView.h"

@implementation RNSVGPathShadowView

#pragma mark - RNCustomPropsProtocol
- (void)handlePropsWith:(NSDictionary *)props {
    NSMutableDictionary *temp = [NSMutableDictionary dictionaryWithDictionary:props];
    [temp addEntriesFromDictionary:self.props];
    self.props = [temp copy];
}

@end
